import React from 'react';

import deadliftLogo from '../resources/deadlift.png'
import google from '../resources/googleplay.png'

function Card({ title, description, showBadge }) {
    return <div className='Card'>
        <img src={deadliftLogo} alt='App logo' id='deadlift'></img>
        <div className='right'>
            <h3>{title}</h3>
            <p>
                {description}
            </p>
            <img src={google} alt='App logo'></img>
        </div>
    </div>
}


export default Card;
